import React from "react";
import { AiOutlineDelete } from "react-icons/ai";
import { BiEdit } from "react-icons/bi";

const Todo = ({ todo }) => {
  return (
    <ul>
      <li className="task" onClick={() => toggleTodo()}>
        <span>{todo.data}</span>
        <span className="icon">
          <AiOutlineDelete />
        </span>
        <span className="icon">
          <BiEdit />
        </span>
      </li>
    </ul>
  );
};

export default Todo;
